INSERT INTO `v1_b51f61b1cdd06b685ea36e86c3f548689926413afa1cd476bd024271dd59202c` VALUES (321, 40011, 1, 0, "リリ", "もうすぐ、みなさまに\nお会いできるのですね。\n胸が高鳴ってしまいます……\n", 1, 24001, 125801, 1, 2);
INSERT INTO `v1_b51f61b1cdd06b685ea36e86c3f548689926413afa1cd476bd024271dd59202c` VALUES (322, 40011, 2, 0, "クリア", "初めまして、クリアです♪\nみなさんと一緒に冒険するの\nとっても楽しみにしてます", 1, 24001, 126001, 1, 2);
INSERT INTO `v1_b51f61b1cdd06b685ea36e86c3f548689926413afa1cd476bd024271dd59202c` VALUES (323, 40011, 3, 0, "プレシア", "んーと。\nこれ、あげる。\nはい", 1, 24001, 126101, 1, 2);
INSERT INTO `v1_b51f61b1cdd06b685ea36e86c3f548689926413afa1cd476bd024271dd59202c` VALUES (324, 40011, 4, 0, "リリ", "あらためまして……\n【アルターメイデン】の\nギルドマスター、リリと申します", 2, 24001, 125801, 1, 2);
INSERT INTO `v1_b51f61b1cdd06b685ea36e86c3f548689926413afa1cd476bd024271dd59202c` VALUES (325, 40011, 5, 0, "クリア", "こんにちは、お兄さん♪\n【アルターメイデン】の\nクリアです", 2, 24001, 126001, 1, 2);
INSERT INTO `v1_b51f61b1cdd06b685ea36e86c3f548689926413afa1cd476bd024271dd59202c` VALUES (326, 40011, 6, 0, "プレシア", "お兄。\nきてくれて、うれしい", 2, 24001, 126101, 1, 2);
